import React from 'react';
import FriendList from './FriendList';
import './style.css'
import FriendInput from './FriendInput';
import dataList from '../assets/friennddata'

const Friend = () => {
    return (
        <div className='wrap'>
            <h1> 친구들 총인원 : xxx</h1>
            <p className = 'chk'>
                <input type="checkbox"/>
                추가 비활성 / 추가활성
            </p>
            <FriendList />
            <p className='btn'>
                <button>모두삭제</button>
                <button>초기 복구</button>
            </p>
            <FriendInput />
        </div>
    );
};

export default Friend;
